The letter codes below refer to maximum bloom status that was documented by the DEC HABs Program in each waterbody in each year.
S (Suspicious Bloom): DEC staff determined that conditions fit the description of a cyanobacteria HAB based on visual observations and/or digital
photographs;
C (Confirmed Bloom): Water sampling results have confirmed the presence of a cyanobacteria HAB which may produce toxins or other harmful
compounds;
HT (Confirmed with High Toxins Bloom): Water sampling results confirmed that there were toxins present in quantities to potentially cause health effects if people or animals came in contact with the water.

